local icon = {
  img='<img src="data:image/png;base64," width="42" height="42" />',
}

function icon.label(ui_mngr)

  return ui_mngr:Label{
      ID = "",
      WordWrap = false,
      Weight = 0,
      MinimumSize = { 42, 42},
      ReadOnly = true,
      Flat = true,
      Alignment = { AlignHCenter = false, AlignTop = true, },
      Text = icon.img,
    }

end

return icon
